    }
    doPost(serviceUrl, body, opts) {
        const ropts = this.createOptions(opts);
        console.log(serviceUrl);
        console.log(body);
        return this.http.post(serviceUrl, body, ropts);
    }
    doDelete(serviceUrl, opts) {
        const ropts = this.createOptions(opts);
        return this.http.delete(serviceUrl, ropts);
    }
    doGetParameters(serviceUrl, parametros, opts) {
        const ropts = this.createOptions(opts);
        const options = parametros !== null ? {
            headers: ropts.headers,
            params: parametros
        } : ropts;
        return this.http.get(serviceUrl, options);
    }
};
